import React from 'react'
import { Container } from '@mui/system'
import { Box } from '@mui/material'
import images from "../media/hero_illustration.jpg"

const Cards = () => {
  return (
    <Container >
      <div
        style={{
          width: "5%",
          height: "5px",
          backgroundColor: "#000339",
          margin: "0 auto",
        }}
      ></div>

<Box sx={{border:"solid 40px grey", borderRadius:"30px", boxShadow:"inherit"}}>
<Box>
<img
src={images}
alt={images}
style={{maxWidth:"300px"}}
/>
</Box>
<h1>Saurabh</h1>
</Box>


<Box>
<Box>
<img
src={images}
alt={images}
style={{maxWidth:"300px"}}
/>
</Box>
<h1>Saurabh</h1>
</Box>

</Container>
  );
}

export default Cards
